class Solution {
    // time limit exceeded
    func minDeletionSize(_ A: [String]) -> Int {
        let map = ["a": 97, "b": 98, "c": 99, "d": 100, "e": 101, "f": 102, "g": 103, "h": 104, "i": 105, "j": 106, "k": 107, "l": 108, "m": 109, "n": 110, "o": 111, "p": 112, "q": 113, "r": 114, "s": 115, "t": 116, "u": 117, "v": 118, "w": 119, "x": 120, "y": 121, "z": 122]
        
        var list = [Int]()
        
        // 按列遍历
        let row = A.count
        if row > 0 {
            let column = A[0].count
            
            if column > 0 {
                // 按列遍历
                var i = 0
                
                while i < column {
                    var j = 0
                    var preChar = "a"
                    
                    while j < row {
                        
                        let str = Array(A[j])
                        let ch = String(str[i])
                        
                        if j > 0 {
                            // 非升序
                            if let v1 = map[ch], let v2 = map[preChar], v1 < v2 {
                                list.append(i)
                                break
                            }
                        }
                        
                        preChar = ch
                        
                        j += 1
                    }
                    
                    i += 1
                }
            }
        }
        
        return list.count
    }
}

extension Character
{
    func toInt() -> Int
    {
        var intFromCharacter:Int = 0
        for scalar in String(self).unicodeScalars
        {
            intFromCharacter = Int(scalar.value)
        }
        
        return intFromCharacter
    }
}


